import React, { useState, Hist } from 'react';
import { Link, To } from 'react-router-dom';

import AddCurso from '../AddCurso';

import { Container } from './style';

const Consulta: React.FC = () => {
  return (
    <Container>
        <form>
            <h1 className='Titulo'>
                Consulta
            </h1>
            <button className='button--adicionar' onClick={() => { history.state(AddCurso) }}>Adicionar Curso</button>
            <button>Ver Curso</button>
            <button className='button--atualizar'>Atualizar Cruso</button>
            <button className='button--delete'>Deletar Curso</button>
            <br />
            <Link to='/'>
                Voltar para a Home.
            </Link>
        </form>
    </Container>
  );
}

export default Consulta;
